import React, { Component } from "react";
import FormPage from "./components/form";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      newTest: {
        layer: [
          { id: 1, selected: true },
          { id: 2, selected: false },
          { id: 3, selected: false },
          { id: 4, selected: false },
          { id: 5, selected: false },
          { id: 6, selected: false },
        ],
        testType: [
          { id: 1, selected: true },
          { id: 2, selected: false },
          { id: 3, selected: false },
        ],
        testName: "",
        testDescription: "",
      },
      basicConfig: {
        target: "",
        protocol: [
          { id: 1, selected: true },
          { id: 2, selected: false },
          { id: 3, selected: false },
        ],
        probing: { default: "Prefer SACK", selected: "Prefer SACK" },
        pathTrace: false,
        // interval: { default: defaultInterval },
        // agents: { defaultAgents },
        // alerts: { enable: { defaultEnable }, rules: { defaultRuleSelect } },
      },
    };
  }
  render() {
    const { newTest, basicConfig } = this.state;

    return <FormPage newTest={newTest} basicConfig={basicConfig} />;
  }
}

export default App;
